class MapProgress {
  name;
  linkIdx;
  detailIdx;
  distance;
  isComplete;
  constructor(obj) {
    obj && Object.assign(this, obj);
  }
  equals(p) {
    return p != null
      && p.name === this.name
      && p.distance === this.distance
      && p.isComplete === this.isComplete
  }
}
class SongScore {
  name;
  difficulty;
  score;
  dxscore;
  dxscorerank;
  dxscoremax;
  apfc;
  sync;
  kind;
  constructor(obj) {
    obj && Object.assign(this, obj);
  }
  equals(s) {
    return s != null
      && s.name == this.name
      && s.difficulty == this.difficulty
      && s.score == this.score
      && s.dxscore == this.dxscore
      && s.apfc == this.apfc
      && s.sync == this.sync
      && s.kind == this.kind
  }
  isEmpty() {
    return this.score == 0 && this.dxscore == 0
  }
}
